import React from 'react';
import '../styles/main_page';

const ConfirmationPage = () => {
    return (
        <div className="main-content">
            <h1>Confirmation</h1>
            <p>Your booking has been confirmed. Enjoy your movie!</p>
        </div>
    );
}

export default ConfirmationPage;
